import dynamic from "next/dynamic";
import {
  Map,
  TileLayer,
  Marker,
  Popup,
  MapControl,
  withLeaflet
} from "react-leaflet";

const mapStyle = {
  margin: 20,
  padding: 20,
  border: "1px solid #DDD"
};

const state = {
  center: {
    lat: 31.698956,
    lng: 76.732407
  },
  marker: {
    lat: 31.698956,
    lng: 76.732407
  },
  zoom: 13,
  draggable: true
};

const DynamicComponentWithNoSSR = dynamic(
  () =>
    import(
      <Map
        center={position}
        zoom={state.zoom}
        style={{
          height: "700px"
        }}
      >
        <TileLayer
          attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
      </Map>
    ),
  { ssr: false }
);

const GibMap = props => <DynamicComponentWithNoSSR />;

export default GibMap;
